import React from 'react';
import NavBar from '../components/NavBar.js';
import EditBar from '../components/EditBar.js';

function NotesPage() {
    return (
        <div>
            <NavBar />
            <EditBar />
            <div style={{ marginTop: '50px' }}>
                <h1>Notes</h1>
                <p>Get into flow state.</p>
            </div>
        </div>
    );
}

export default NotesPage
